RS.Application().ready(function(){var a=$(".js-newslist");window.location.hash&&a.find('.collapsed[href="#collapse_'+window.location.hash.split("#")[1]+'"]').click(),a.find("[data-filter]").on("click",function(i){i.preventDefault();var n=$(this).data("filter");n?(a.find(".panel").show().not('[data-section="'+n+'"]').hide(),a.find(".panel:visible:eq(0)").click()):a.find(".panel").show(),$(this).removeClass("btn-default").addClass("btn-primary").siblings(".btn-primary").removeClass("btn-primary").addClass("btn-default")})});